- apiVersion: v1
  data:
    hue-ini: |
      [desktop]

      [[database]]
      engine=django.db.backends.postgresql
      host=postgres-hue
      port=5432
      user=hue
      password=huepassword
      name=hue

      [aws]
      [[aws_accounts]]
      [[[default]]]
      access_key_id=
      secret_access_key=
      region=us-east-1

      [notebook]
      [[interpreters]]
          [[[postgresql]]]
        name = postgresql
        interface=sqlalchemy
        options='{"url": "postgresql://hue:hue@postgres-hue:5432/hue"}'
    hue.ini: |
      [desktop]
      secret_key=YOUR_SECRET_KEY_HERE
      http_host=0.0.0.0
      http_port=8888
      time_zone=UTC

      [[database]]
      engine=postgresql_psycopg2
      host=postgres-hue
      port=5432
      user=hue
      password=hue
      name=hue

      [beeswax]
      hive_server_host=hiveserver2
      hive_server_port=10000
      hive_metastore_host=hive-metastore-fixed
      hive_metastore_port=9083

      [hadoop]
      [[hdfs_clusters]]
      [[[default]]]
      fs_defaultfs=hdfs://namenode:8020
      webhdfs_url=http://namenode:9870/webhdfs/v1

      [[yarn_clusters]]
      [[[default]]]
      resourcemanager_api_url=http://spark-master:8080

      [spark]
      livy_server_host=spark-master
      livy_server_port=8998
